import React, { useEffect, useState } from "react";
import axios from "axios";

const BooksList = (props) => {
	const [books, setBooks] = useState(null);

	useEffect(() => {
		axios
			.get("http://localhost:3004/books")
			.then((res) => {
				console.log(res);
			})
			.catch((err) => console.log(err));
	}, []);
	return (
		<div className="container my-5">
			<table className="table ">
				<thead className="thead">
					<tr className="table-dark">
						<th scope="col">#</th>
						<th scope="col">BOOK NAME</th>
						<th scope="col">AUTHOR</th>
						<th scope="col">TYPE</th>
						<th scope="col">ISBN NO</th>
						<th scope="col"> EDIT </th>
					</tr>
				</thead>
				<tbody className="tbody">
					<tr>
						<th className="list-number" scope="row">
							1
						</th>
						<td className="book-name">Bir Astronotun Sonsuz Yolculuğu</td>
						<td className="author-name">Jaroslav Kalfar </td>
						<td> Roman </td>
						<td> ISBN NO </td>
						<td>
							<button className="btn btn-primary">
								{" "}
								<i className="fa-solid fa-pen-to-square"></i>
							</button>
						</td>
					</tr>
					<tr>
						<th className="list-number" scope="row">
							2
						</th>
						<td className="book-name">Otostopçunun Galaksi Rehberi</td>
						<td className="author-name">Douglas Adams </td>
						<td> Roman </td>
						<td> ISBN NO </td>
						<td>
							<button className="btn btn-primary">
								{" "}
								<i class="fa-solid fa-pen-to-square"></i>
							</button>
						</td>
					</tr>
				</tbody>
			</table>
		</div>
	);
};

export default BooksList;
